import React from 'react';
import classes from './MealItem.module.css';

const MealItem = () => {
    return (
        <div className={classes.meal}>
            <h3>ItemName</h3>
            <p className={classes.description}>Description</p>
            <p className={classes.price}>$50</p>
        </div>
    );
};

export default MealItem;
